import React from 'react'
import Image1 from "./assets/background1.jpg"
export const login = () => {


  return (
    <div className='login'>
      
      <div className="mask">
        <img className="image" src={Image1} alt="Image1" />

      </div>
      <div className="content">

      </div>



      
    </div>
  )

}

export default login;
